import React from 'react';
import '../css/Strategic.css';


export default () => {



    return(
        <div className='container mt-5 text-center'>
            <div className='col-sm-12'>
                <h4 className='title'> Strategic </h4>
            </div>
            <div className='statement'>
                <p>I can (Thinking Skill) the <br/>
                (dimension of differentiation) <br/>
                of the <br/>
                (subject).
                I will get/organize information by (research skill) and share my findings by/in (product).</p>
            </div>
        </div>
    )
}
